    parameters:
    - id: location
      type: System.String
      description: Resource location.
    - id: origins
      type: System.Collections.Generic.IList{Microsoft.Azure.Management.Cdn.Models.DeepCreatedOrigin}
      description: >-
        The source of the content being delivered via

        CDN.
    - id: id
      type: System.String
      description: Resource ID.
    - id: name
      type: System.String
      description: Resource name.
    - id: type
      type: System.String
      description: Resource type.
    - id: tags
      type: System.Collections.Generic.IDictionary{System.String,System.String}
      description: Resource tags.
    - id: originHostHeader
      type: System.String
      description: >-
        The host header CDN sends along with

        content requests to origin. The default value is the host name of

        the origin.
    - id: originPath
      type: System.String
      description: >-
        The path used when CDN sends request to

        origin.
    - id: contentTypesToCompress
      type: System.Collections.Generic.IList{System.String}
      description: >-
        List of content types on which

        compression applies. The value should be a valid MIME type.
    - id: isCompressionEnabled
      type: System.Nullable{System.Boolean}
      description: >-
        Indicates whether content

        compression is enabled on CDN. Default value is false. If

        compression is enabled, content will be served as compressed if

        user requests for a compressed version. Content won't be compressed

        on CDN when requested content is smaller than 1 byte or larger than

        1 MB.
    - id: isHttpAllowed
      type: System.Nullable{System.Boolean}
      description: >-
        Indicates whether HTTP traffic is

        allowed on the endpoint. Default value is true. At least one

        protocol (HTTP or HTTPS) must be allowed.
    - id: isHttpsAllowed
      type: System.Nullable{System.Boolean}
      description: >-
        Indicates whether HTTPS traffic is

        allowed on the endpoint. Default value is true. At least one

        protocol (HTTP or HTTPS) must be allowed.
    - id: queryStringCachingBehavior
      type: System.Nullable{Microsoft.Azure.Management.Cdn.Models.QueryStringCachingBehavior}
      description: >-
        Defines the query string

        caching behavior. Possible values include: 'IgnoreQueryString',

        'BypassCaching', 'UseQueryString', 'NotSet'
    - id: optimizationType
      type: System.String
      description: >-
        Customer can specify what scenario

        they want this CDN endpoint to optimize, e.g. Download, Media

        services. With this information we can apply scenario driven

        optimization.
    - id: geoFilters
      type: System.Collections.Generic.IList{Microsoft.Azure.Management.Cdn.Models.GeoFilter}
      description: >-
        List of rules defining user geo access

        within a CDN endpoint. Each geo filter defines an acess rule to a

        specified path or content, e.g. block APAC for path

        /pictures/
    - id: hostName
      type: System.String
      description: >-
        The host name of the endpoint structured as

        {endpointName}.{DNSZone}, e.g. consoto.azureedge.net
    - id: resourceState
      type: System.String
      description: >-
        Resource status of the endpoint.

        Possible values include: 'Creating', 'Deleting', 'Running',

        'Starting', 'Stopped', 'Stopping'
    - id: provisioningState
      type: System.String
      description: >-
        Provisioning status of the

        endpoint.
